Using Maven Tycho it is possible to build OSGi applications and therefore Eclipse RCP applications easily with Maven. Creating a ready to run product is already described on the internet a few times.

But what is mostly missing is, how to make an nice Mac OS X application bundle, that looks like a real Mac OS X application and not like a bunch of files extracted from a ZIP/TAR file.
Assuming you already have set up your Maven Tycho RCP build and are building products using the packaging type â€œeclipse-repositoryâ€ here is what you need to do in addition.
Extend the configuration in the â€œeclipse-repositoryâ€ project by calling (or enhancing the call) to:
&lt;plugin&gt;
  &lt;groupId&gt;org.eclipse.tycho&lt;/groupId&gt;
  &lt;artifactId&gt;tycho-p2-director-plugin&lt;/artifactId&gt;
  &lt;version&gt;${tycho-version}&lt;/version&gt;
&lt;/plugin&gt;

If you donâ€™t have a configuration element for this plugin yet, then add it as a child element and configure the specific product you are building:
&lt;plugin&gt;
  &lt;groupId&gt;org.eclipse.tycho&lt;/groupId&gt;
  &lt;artifactId&gt;tycho-p2-director-plugin&lt;/artifactId&gt;
  &lt;version&gt;${tycho-version}&lt;/version&gt;
  &lt;configuration&gt;
    &lt;formats&gt;
      &lt;win32&gt;zip&lt;/win32&gt;
      &lt;linux&gt;tar.gz&lt;/linux&gt;
      &lt;macosx&gt;tar.gz&lt;/macosx&gt;
    &lt;/formats&gt;

    &lt;products&gt;
      &lt;product&gt;
        &lt;id&gt;${group.id}.${artifact.id}&lt;/id&gt;
        &lt;rootFolders&gt;
          &lt;macosx&gt;My Application.app&lt;/macosx&gt;
        &lt;/rootFolders&gt;
      &lt;/product&gt;
    &lt;/products&gt;
  &lt;/configuration&gt;
&lt;/plugin&gt;

${group.id} and ${artifact.id} make up the id of your application. Which must be consistent with the id property in the .product file.
The most important thing is the configuration of the â€œrootFolderâ€ for the target type Mac OS X here. It would also be possible to use the plain â€œrootFolderâ€ property, but using â€œrootFoldersâ€ (with the â€œsâ€) it is possible to just make an alternate name for Mac OS X.
In addition to that tell the repository bundle (in the same Maven project) to generate for Mac OS X.
&lt;plugin&gt;
  &lt;groupId&gt;org.eclipse.tycho&lt;/groupId&gt;
  &lt;artifactId&gt;tycho-p2-repository-plugin&lt;/artifactId&gt;
  &lt;version&gt;${tycho-version}&lt;/version&gt;
  &lt;configuration&gt;
    &lt;includeAllDependencies&gt;true&lt;/includeAllDependencies&gt;
    &lt;profileProperties&gt;
      &lt;macosx-bundled&gt;true&lt;/macosx-bundled&gt;
    &lt;/profileProperties&gt;
  &lt;/configuration&gt;
&lt;/plugin&gt;

Running maven package will now give you a products folder under your output folder (normally target) which hosts a zipped version of your Mac OS X app bundle, which extracts to â€œMy Application.appâ€ and shows in the finder as â€œMy Applicationâ€.

