While working on Package Drone, I stumbled over an interesting issue.
Deploying to Package Drone using Maven requires a deploy key. A random token, generated by the server which has to be used as either username or password on the basic authentication process of HTTP.

This worked fine as long as I started â€œmaven deployâ€ from inside the Eclipse IDE. Starting â€œmaven deployâ€ using the external maven installation or from the command line caused:
Caused by: org.apache.maven.wagon.TransferFailedException: Failed to transfer file: http://localhost:8080/maven/m2test/de/dentrassi/test/felixtest1/0.0.1-SNAPSHOT/felixtest1-0.0.1-20150217.162541-1.jar. Return code is: 401, ReasonPhrase: Unauthorized.

Although I did configure Maven to use the correct credentials in the settings.xml file:
&lt;server&gt;
  &lt;username&gt;&lt;/username&gt;
  &lt;password&gt;abc123&lt;/password&gt;
  &lt;id&gt;pdrone.test&lt;/id&gt;
&lt;/server&gt;

After several hours of googling, source code reading and debugging maven it was actually pretty easy.
First of all, the embedded Maven instance in Eclipse uses AetherRepositoryConnector instead of BasicRepositoryConnector for accessing repositories. â€œAetherâ€ simply takes the username and password values, as provided, and uses them.
The â€œBasicRepositoryConnectorâ€ however decided that an empty username (or an empty password) is not good at all and simply dropped the whole configuration without warning.
So in the end, introducing a dummy user name did the trick.

https://staging.dentrassi.de/2015/07/17/.body:
Now I have been working with the Eclipse platform for quite a while. If you do so, you already might have run into the â€œadaptableâ€ mechanism the Eclipse platform provides (article on EclipseZone).
The basics
The basic idea is to â€œcastâ€ one object into the class of another, allowing to step into the process and maybe return a new object instance if casting is not possible, so adapting to the requested interface. This is nothing new, but comes in handy every now and then. Especially since the Eclipse platform allows an â€œexternalâ€ adapter mechanism to control this adaption process. Simply assume you do have a class â€œMyModelDocumentâ€, which is used throughout your Eclipse application. Now somebody selects the UI element, backed by an instance of your class and you want the Eclipse UI to show the properties of your instance in the Eclipse properties view. This is done by an instance of IPropertySource. At first this would mean you need you class to implement IPropertySource and do this for every other aspect you want to add to your model. In addition of implementing the interface you would also aggregate a lot of dependencies in the bundle of your model.
But there is a better way thanks to the adapter framework. First of all your class â€œMyModelDocumentâ€ can use the adapter framework and simply create and adapter class, which has to implement IPropertySource, but is backed by the original instance of your â€œMyModelDocumentâ€ class. Second, you can create a new bundle/plugin which defines an extension point named â€œorg.eclipse.core.runtime.adaptersâ€ and implement a class based on IAdapterFactory.
Generics
Now a typical implementation of this class in Java 5+ looked like this:
public class MyAdapterFactory implements IAdapterFactory {
  @SuppressWarnings ("unchecked")
  @Override
  public Object getAdapter (
    final Object adaptableObject,
    final Class adapterType ) {

    if ( !(adaptableObject instanceof MyModelDocument) ) {
      return null;
    }

    if ( IPropertySource.class.equals ( adapterType ) ) {
      return new MyModelDocumentPropertySourceAdapter ( adaptableObject );
    }

    return null;
  }

  @SuppressWarnings ( â€œuncheckedâ€ )
  @Override
  public Class[] getAdapterList () {
    return new Class[] { IPropertySource.class };
  }
}

Of course the @SuppressWarnings for â€œuncheckedâ€ could be left out, but would trigger a bunch of warnings. The cause simply was that IAdapterFactory did not provide make use of Java 5 generics.
In a recent update of the Eclipse platform this interface has been extended to allow the use of generics, the method Object getAdapter (â€¦) is now &lt;T&gt; T getAdapter(â€¦). While this does not really benefit implementations of the class itself (IMHO), it cleans up the warnings if you do it right ;-)
Keep in mind that the type parameter &lt;T&gt; is a complete variable thing for the factory itself, since it will allow adapting to any kind if type some other class requests. So you actually will never be able to make a specific substitution for &lt;T&gt;. The return type of getAdapter() will change to T, which requires you to actually cast to T. Which can be done in two ways. Either by casting using:
return (T)new MyModelDocumentPropertySourceAdapter ( adaptableObject );

Which will trigger the next warning right away. Since there is no way to actually do the cast. Type erasure will kill the type information during runtime! The way to work around this has always been in Java to actually pass the type in such situations. Like a TypedQuery in JPA, the IAdapterFactory already has the type information as a parameter an so you can a programmatic cast instead:
return adapterType.cast ( new MyModelDocumentPropertySourceAdapter ( adaptableObject ) );

So the full code would look like:
public class MyAdapterFactory implements IAdapterFactory {
  @Override
  public &lt;T&gt; T getAdapter (
    final Object adaptableObject,
    final Class&lt;T&gt; adapterType ) {

    if ( !(adaptableObject instanceof MyModelDocument) ) {
      return null;
    }

    if ( IPropertySource.class.equals ( adapterType ) ) {
      return adapterType.cast (
        new MyModelDocumentPropertySourceAdapter ( adaptableObject )
      );
    }

  return null;
}

  @Override
  public Class&lt;?&gt;[] getAdapterList () {
    return new Class&lt;?&gt;[] { IPropertySource.class };
  }
}

https://staging.dentrassi.de/2015/07/22/.body:
For me Java 8 wasnâ€™t a big deal â€¦ until I had to go back to Java 7. Suddenly I started missing things I started using without even realizing it. Here comes Optional&lt;T&gt;:

Assume we have some sort of class (Provider) which does something and has a â€œgetNameâ€ method. Now we also have a method in a class managing providers which returns the provider by id, so we pass in a string ID and get back a provider:
static class Provider {
  String getName () {
    return "bar";
  }
}

static Provider getProvider (final String id) {
  if ("foo".equals ( id )) {
    return new Provider ();
  }
  return null;
}

In this simple example the manager only knows the provider â€œfooâ€, which will return â€œbarâ€ as its name. All requests for other providers will return null. A real life scenario might have a Map, which also returns null in case of a missing element.
Now a pretty common code snippet before Java 8 would look like this:
final Provider provider = getProvider ( â€œbarâ€ );
final String value;

if ( provider != null ) {
  value = provider.getName ();
} else {
  value = null;
}

System.out.println ( â€œBar (pre8): â€œ + value );

Pretty noisy. So the first step is to use the â€œOptionalâ€ type, and to guarantee that the getProvider method never returns null. So we donâ€™t have to check for it:
static Optional&lt;Provider&gt; getOptionalProvider ( final String id ) {
  return Optional.ofNullable ( getProvider ( id ) );
}

In this case a new method was added, which simply calls the old one. The next thing is to use Optional.map(â€¦) and Optional.orElse(â€¦) to transform the value and return a default if we donâ€™t have a value.
String value1 = getOptionalProvider ( "foo" )  
 .map ( Provider::getName )  
 .orElse ( null );  
System.out.println ( "Foo: " + value1 );  

Pretty simple actually. But still readable and understandable (although some people might disagree on that one ;-) ).
So what does happen? First the call to getOptionalProvider will now never return null. If the value itself would be null, it would return an empty Optional but still a class instance. Actually always the same, since there is only one instance of an empty Optional. Next the map method will call the provided expression (longer version would be: value -&gt; value.getName()), but the method will only do this if the Optional is not empty. Otherwise it will return an empty Optional again. So after calling map we either have an Optional&lt;String&gt; with the value of getName(), or again an empty Optional. Calling orElse on this new Optional will either return the value of the Optional or the default value provided, null in this case.
Of course one could argue that internally the same logic happens as with Java 7 and before. But I think that this way, you actually can do a one-liner which is understandable but still does not obstruct the your actual class with to many lines of code just or checking about null.
Full sample:
import java.util.Optional;

public class Manager {

  static class Provider {
    String getName () {
      return "bar";
    }
  }

  static Provider getProvider ( final String id ) {
    if ( "foo".equals ( id ) ) {
      return new Provider ();
    }
    return null;
  }

  static Optional&lt;Provider&gt; getOptionalProvider ( final String id ) {
    return Optional.ofNullable ( getProvider ( id ) );
  }

  public static void main ( final String[] args ) {
    final String value1 = getOptionalProvider ( â€œfooâ€ ).map ( Provider::getName ).orElse ( null );
    System.out.println ( â€œFoo: â€œ + value1 );

    final String value2 = getOptionalProvider ( â€œbarâ€ ).map ( Provider::getName ).orElse ( null );
    System.out.println ( â€œBar: â€œ + value2 );

    // before Java 8

    final Provider provider = getProvider ( â€œbarâ€ );
    final String value3;
    if ( provider != null ) {
      value3 = provider.getName ();
    } else {
      value3 = null;
    }

    System.out.println ( â€œBar (pre8): â€œ + value3 );
  }
}

https://staging.dentrassi.de/2015/07/28/.body:
Now when you build OSGi bundles using Maven Tycho, you probably ran into the issue of creating a meaningful version qualifier (remember, an OSGi versions always is major.minor.micro.qualifier, so no dash and definitely no -SNAPSHOT).
There are a few approaches ranging from fully manual assignment of the build qualifier, simple timestamps and timestamps based on the last Git change.
The background
The latter one is described in the â€œReproducible Version Qualifiersâ€ wiki page of Tycho as a recipe to create the same qualifier from the same source code revision.
Actually the idea is pretty simple, so instead of the current timestamp, the last relevant change in the git repository, for the directory of the bundle, is located and then used to generate the timestamp based qualifier.
As a side note: Personally I came to the conclusion, that this sounds great in the beginning, but turns out to be troublesome later. First if all, the Build Qualifier plugin conflicts with the Source Ref Plugin, which generates a different manifest. Both plugins find different last commits and therefore a different MANIFEST.MF gets generated. So two builds produce two bundles, with the same qualifier, but actually (due to the MANIFEST.MF) different content, with two different checksums, which causes issues later on and has to be cleaned up by some baseline repository matching. In addition you simple cannot guarantee that two different builds come to the same result. Too many components (actually Maven and the local host) are outside of the source code repository and still influence the output of the build. But this post is about the JGit based timestamps ;-)
A simple configuration using the Git based approach looks like this in the parent pom file:
&lt;plugin&gt;
  &lt;groupId&gt;org.eclipse.tycho&lt;/groupId&gt;
  &lt;artifactId&gt;tycho-packaging-plugin&lt;/artifactId&gt;
  &lt;version&gt;${tycho.version}&lt;/version&gt;
  &lt;dependencies&gt;
    &lt;dependency&gt;
      &lt;groupId&gt;org.eclipse.tycho.extras&lt;/groupId&gt;
      &lt;artifactId&gt;tycho-buildtimestamp-jgit&lt;/artifactId&gt;
      &lt;version&gt;${tycho-extras.version}&lt;/version&gt;
    &lt;/dependency&gt;
  &lt;/dependencies&gt;
  &lt;configuration&gt;
    &lt;timestampProvider&gt;jgit&lt;/timestampProvider&gt;
    &lt;jgit.ignore&gt;
    pom.xml
    &lt;/jgit.ignore&gt;
  &lt;/configuration&gt;
&lt;/plugin&gt;

As you can see, there is a configuration property jgit.ignore which allows to exclude a set of files in the search of the last relevant commit. So git changes, which are only changing files which are ignored, are also ignored in this search for the last modification timestamp. Since the pom.xml will probably just get changed to point to a different parent POM, this seems like a good idea.
The problem
Now what does happen, when there are uncommitted changes in the working tree? Then it would not be possible for the build to determine the last relevant commit, since the change is not committed! Maven Tycho does provide a way to handle this (aka â€œDirty working tree behaviourâ€) and will allow you to ignore this. Which might not be a good idea after all. The default behavior is to simply error and fail the build.
For me it became a real annoyance when it complained about the â€œtargetâ€ directory itself. The truth is, this output directory should be added to the â€œ.gitignoreâ€ file anyway, which would then also be respected by the git based build timestamp provider. But then again it should not fail the build just because of that.
Solution
But the solution to that was rather trivial. The jgit.ignore property follows the git ignore syntax and also allows to specify directories:
&lt;jgit.ignore&gt;
pom.xml
target/
&lt;/jgit.ignore&gt;

There are two things which have to be kept in mind: each entry goes to a new line, the root of the evaluation seems no the be the root of the project, so using â€œ/target/â€ (compared to â€œtarget/â€œ) does not work.

https://staging.dentrassi.de/2015/09/18/.body:
One of the most advertised use cases of the new lambdas in Java 8 is the possibility to stream collections and transform it. The â€œseries of tubesâ€ has a lot of examples on how to do this, I just wanted to look at it from a different perspective, readability.

So starting with a real-life problem of a map Map&lt;ResultKey, List&gt; result which I want to transform into a Set&lt;String&gt;.
Before Java 8, I had something like:
Set&lt;String&gt; ids = new HashSet&lt;&gt; ();
for ( List&lt;ResultEntry&gt; list : result.values () ) {
  for ( ResultEntry entry : list ) {
    if ( entry.getAction () == Action.DELETE ) {
      String id = entry.getArtifact ().getId ();
      ids.add ( id );
    }
  }
}

Now, with Java 8, I can do:
Set&lt;String&gt; deleteSet = result.values ().stream ()
  .flatMap ( list -&gt; list.stream () )
  .filter ( entry -&gt; entry.getAction () == Action.DELETE )
  .map ( entry -&gt; entry.getArtifact ().getId () )
  .collect ( Collectors.toSet () );
context.deleteArtifacts ( deleteSet );

Neither one is shorter nor seems less complex from an initial view. So, which one is better?

