Sometimes you write something and then you nearly forget that you did it â€¦ although it is quite handy sometimes, here are a few lines of Apache Camel XML running in Eclipse Kura:

I just wanted to publish some random data from Kura to Kapua, without the need to code, deploy or build anything. Camel came to the rescue:
&lt;routes xmlns="http://camel.apache.org/schema/spring"&gt;
  &lt;route id="route1"&gt;

    &lt;from uri="timer:1"/&gt;
    &lt;setBody&gt;&lt;simple&gt;${bean:payloadFactory.create("value", ${random(100)})}&lt;/simple&gt;&lt;/setBody&gt;
    &lt;to uri="kura-cloud:myapp/topic"/&gt;

  &lt;/route&gt;
&lt;/routes&gt;

Dropping this snippet into the default XML Camel router:

Registers a Kura application named myapp
Creates a random number between 0 and 100 every second
Converts this to the Kura Payload structure
And publishes it on the topic topic

https://staging.dentrassi.de/2018/05/18/.body:
PEM is a well know file format when it comes to certificates. And when using Kubernetes (or OpenShift in my case) it is so easy to re-use the internal CA for some tasks.

Except when it comes to Java. As Java does only use JKS (its Java-only, binary keystore) or PKCS12 for keys and certificates. Google offers you a bunch of tutorials, on how to convert PEM encoded certificates to JKS or PKCS12, so that Java can consume that. But that may be ugly in a lot of situations. Doing that manually once if fine. But adding this to e.g. a pod, becomes a lengthy YAML init container setup, which seems unnecessary to me.
But Java does allow the use of security providers, which may extend the security system. However searching the net, I couldnâ€™t find anything which would provider a PEM based KeyStore. Maybe that was simply due to the fact that the over â€œconvert PEM to â€¦â€ tutorials spammed the search results.
So I went along and simply created my own provider. For my own use case, which is using the OpenShift service CA certificate. It only took a few minutes to do the actual implementation as reading a PEM file is no mystery.
In case you need to use a PEM encoded X.509 certificate in Java, you now can either re-encode that with openssl on the command line or simply drop on this provider and use PEM as the KeyStore type:
&lt;dependency&gt;
  &lt;groupId&gt;de.dentrassi.crypto&lt;/groupId&gt;
  &lt;artifactId&gt;pem-keystore&lt;/artifactId&gt;
  &lt;version&gt;2.0.0&lt;/version&gt;
&lt;/dependency&gt;

And then:
KeyStore keyStore = KeyStore.getInstance("PEM");

For more information see: ctron/pem-keystore at GitHub
If you know some other provider which supports this, please let me know and I would be happy to switch as this is only a scratch to my itch :) On the other hand if this is useful to you, then please let me know. There are still a few things missing, like keys and Java 9+ support. But maybe you want to submit a pull request for that :D
Update: I did release an update of this provider. Version 2.0 has support for keys and CA bundles.

https://staging.dentrassi.de/2018/09/17/.body:
Part #1 of the Apache Camel to Kura Wires integration tutorial did focus on pushing data from Kura Wires to Camel and processing it there. But part #1 already mentioned that it is also possible to pull in data from Camel into Kura Wires.


Preparations
For the next step, you again need to install a Camel package, for interfacing with Open Weather Map: https://repo1.maven.org/maven2/de/dentrassi/kura/addons/de.dentrassi.kura.addons.camel.weather/0.6.0/de.dentrassi.kura.addons.camel.weather-0.6.0.dp The installation follows the same way as already described in part #1.
In addition to the installation of the package, you will also need to create an account at https://openweathermap.org/ and create an API key. You can select the free tier plan, it is more than enough for our example.
Back to Wires
Next, create a new Camel context, like before, and give it the ID â€œcamel2â€. Add the required component weather, the required language groovy and set the following XML router content (be sure to replace &lt;appid&gt; with your API token):
&lt;routes xmlns="http://camel.apache.org/schema/spring"&gt;

  &lt;route&gt;

    &lt;from uri="weather:dummy?appid=&lt;YOUR API TOKEN&gt;&amp;amp;lat=48.1351&amp;amp;lon=11.5820"/&gt;
    &lt;to uri="stream:out"/&gt;

    &lt;unmarshal&gt;&lt;json library="Gson"&gt;&lt;/json&gt;&lt;/unmarshal&gt;
    &lt;transform&gt;&lt;simple&gt;${body["main"]["temp"]}&lt;/simple&gt;&lt;/transform&gt;
    &lt;convertBodyTo type="java.lang.Double"/&gt;
    &lt;to uri="stream:out"/&gt;

    &lt;transform&gt;&lt;groovy&gt;["TEMP": request.body-273.15]&lt;/groovy&gt;&lt;/transform&gt;
    &lt;to uri="stream:out"/&gt;
    &lt;to uri="seda:output1"/&gt;

  &lt;/route&gt;

&lt;/routes&gt;

After applying the changes, you can create two new components in the Wire graph:

Create a new â€œCamel Consumerâ€, name it consumer1

Set the Camel context ID camel2
Set the endpoint URI seda:output1


Create a new â€œLoggerâ€, name it logger1

Set it to â€œverboseâ€


Connect consumer1 with logger1
Click on â€œApplyâ€ to activate the changes

What does it do?
What this Camel context does, is to first start polling information from the Open Weather Map API. It requests with a manually provided GPS location, Munich.
It then parses the JSON, so that we can work with the data. Then it extracts the current temperature from the rather complex Open Weather Map structure. Of course, we could also use a different approach and extract additional or other information.
The extracted value could still be a number, represented internally by a string. So we ask Camel to ensure that the body of the message gets converted to a Double. If the body already is a double, then nothing will be done. But, if necessary, Camel will pull in its type converter system and optionally convert e.g. a string to a double by parsing it.
Now the body contains the raw value, as a Java double. But we still have two issues with that. The first one is, that the value is in degree Kelvin. Living in Germany, I would expect degree Celsius ;-) The second issue is, that Kura Wires requires some kind of key to that value, like a Map structure.
Fortunately, we easily can solve both issues with a short snippet of Groovy: ["TEMP": request.body-273.15]. This will take the message (request) body, convert it to degree Celsius, and using this as a value for the key TEMP in the newly created map.
Checking the result
As soon as you apply the changes, you should see some output on the console, which shows the incoming weather data:
{"coord":{"lon":11.58,"lat":48.14},"weather":[{"id":801,"main":"Clouds","description":"few clouds","icon":"02d"}],"base":"stations","main":{"temp":297.72,"pressure":1021,"humidity":53,"temp_min":295.15,"temp_max":299.15},"visibility":10000,"wind":{"speed":1.5},"clouds":{"all":20},"dt":1537190400,"sys":{"type":1,"id":4914,"message":0.0022,"country":"DE","sunrise":1537160035,"sunset":1537204873},"id":2867714,"name":"Muenchen","cod":200}
297.72
{TEMP=24.57000000000005}

Every change, which should happen every second, shows three lines. First the raw JSON data, directly from the Open Weather Map API. Then the raw temperature in degree Kelvin, parsed by Camel and converted into a Java type already. Followed by the custom Map structure, created by the Groovy script. The beauty here is again, that you donâ€™t need to fiddle around with custom data structures of the Kura Wires system, but can rely on standard data structures likes plain Java maps.
Looking at the Kura log file, which is by default /var/log/kura.log, you should see some output like this:
2018-09-17T13:57:10,117 [Camel (camel-15) thread #31 - seda://output1] INFO  o.e.k.i.w.l.Logger - Received WireEnvelope from org.eclipse.kura.wire.camel.CamelConsume-1537188764126-1
2018-09-17T13:57:10,117 [Camel (camel-15) thread #31 - seda://output1] INFO  o.e.k.i.w.l.Logger - Record List content:
2018-09-17T13:57:10,118 [Camel (camel-15) thread #31 - seda://output1] INFO  o.e.k.i.w.l.Logger -   Record content:
2018-09-17T13:57:10,118 [Camel (camel-15) thread #31 - seda://output1] INFO  o.e.k.i.w.l.Logger -     TEMP : 24.57000000000005
2018-09-17T13:57:10,118 [Camel (camel-15) thread #31 - seda://output1] INFO  o.e.k.i.w.l.Logger -

This shows the same value, as processed by the Camel context but received by Kura Wires.
Wrapping it up
Now, of course, a simple logger component isnâ€™t really useful. But as you might now, Kura has the ability to connect to a GPS receiver. So you could also take the current position as an input to the Open Weather Map request. And instead of using my static GPS coordinates of Munich, you could query for the nearby weather information. So this might allow you to create some amazing IoT applications.
Stay tuned for Part #3, where we will look at a Camel based solution, which can run inside of Kura, as well as outside. Including actual unit tests, ready for continuous delivery.

https://staging.dentrassi.de/2019/07/06/.body:
A while back I wrote a blog post about OPC UA, using Milo and added a bunch of examples, in order to get you started. Time passed by and now Milo 0.3.x is released, with a changed API and so those examples no longer work. Not too much has changed, but the experience of running into compile errors isnâ€™t a good one. Finally I found some time to update the examples.
This blog post will focus on the changes, compared to the old blog post. As the old blog post is still valid, I though it might make sense to keep it, and introduce the changes of Milo here. The examples repository however is updated to show the new APIs on the master branch.
Making contact
This is the first situation where you run into the changed API, getting the endpoints. Although the new code is not much different, the old will no longer work:
List&lt;EndpointDescription&gt; endpoints =
  DiscoveryClient.getEndpoints("opc.tcp://localhost:4840")
    .get();

When you compare that to the old code, then you will notice that instead of an array, now a list is being used and the class name changed. Not too bad.
Also, the way you create a new client instance with Milo 0.3.x is a bit different now:
OpcUaClientConfigBuilder cfg = new OpcUaClientConfigBuilder();
cfg.setEndpoint(endpoints[0]); // please do better, and not only pick the first entry

OpcUaClient client = OpcUaClient.create(cfg.build());
client.connect().get();

Using the static create method instead of the constructor allows for a bit more processing, before the class instance is actually created. Also may this new method throw an exception now. Handling this in an async way isnâ€™t too hard when you are using Java 9+:
public static CompletableFuture&lt;OpcUaClient&gt; createClient(String uri) {
  return DiscoveryClient
    .getEndpoints(uri) // look up endpoints from remote
    .thenCompose(endpoints -&gt; {
      try {
        return CompletableFuture.completedFuture(
            OpcUaClient.create(buildConfiguration(endpoints)) // "buildConfiguration" should pick an endpoint
        );
      } catch (final UaException e) {
        return CompletableFuture.failedFuture(e);
      }
    });
}

Thatâ€™s it? Thatâ€™s it!
Well, pretty much. However, we have only been looking at the client side of Milo. Implementing your own server requires to use the server side API, and that change much more. But to be fair, the changes improve the situation a lot, and make things much easier to use.
Milo examples repository
As mentioned, the examples in the repository ctron/milo-ece2017 have been updated as well. They also contain the changed server side, which changed a lot more than the client side.
When you compare the two branches master and milo-0.2.x, you can see the changed I made for updating to the new version.
I hope this helps a bit in getting started with Milo 0.3.x. And please be sure to read the original post, giving a more detailed introduction, as well.

