A cheatsheet for EMF annotations which influence the code generation of GenModels.
The â€œGenâ€ pattern
Although is has nothing to do with annotations, it is a powerful instrument during the generation process.
A method name can be suffixed with â€œGenâ€ and by that â€œmoved out of the wayâ€, but still be generated.
Assume you have a method that is generated an called â€œinitâ€. You can rename the method to â€œinitGenâ€ and keep (!!) the â€œ@generatedâ€ marker. This will let the generation tools still generate the method â€œinitâ€ but as â€œinitGenâ€. The method â€œinitâ€ is missing then as has to be provided manually. But from this method you can call â€œinitGenâ€ and, to some degree, influence what happens.
See below for an example.
http://www.eclipse.org/emf/2002/GenModel
Common
NameDescription
documentationThe documentation for this model element
copyrightCopyright information for this model element

Feature
NameDescription
getThe code of the getter method.
suppressedGetVisibilityâ€œtrueâ€ or â€œfalseâ€. Suppres the creation of the getter for this feature.
suppressedSetVisibilityâ€œtrueâ€ or â€œfalseâ€. Suppress the creation of the setter for this feature.
suppressedIsSetVisibilityâ€œtrueâ€ or â€œfalseâ€. Suppress the creation of the isSet method for this feature.
suppressedUnsetVisibilityâ€œtrueâ€ or â€œfalseâ€. Suppress the creation of the unset method for this feature.

Operation
NameDescription
bodyThe body contents used when generating the method for the operation.

DataType
NameDescription
createThe body of the creator method.
convertThe body of the convertor method.

http://www.eclipse.org/emf/2002/Ecore
All
NameDescription
constraintsA whitespace delimited list of constraints.The constraint expression is then fetched from an annotation of the same model element. All validation delegates (URIs) are tried to load as annotation URI with the constraint name as value. So for example if a model element has â€œconstraints=test1 test2â€ and the package has the â€œvalidationDelegatesâ€ value set to â€œurn:delegate1â€ then the annotation urn:delegate1#test1 and urn:delegate1#test2 will be loaded.  If there is no expression present it will create a dummy method in the Validator class with must be implemented by the user. And marked with â€œ@genenreated NOTâ€.

Package
NameDescription
validationDelegatesA whitespace separated list of validation delegate URIs.e.g. â€œurn:deletegate1 urn:delegate2â€

Examples
A â€œGenâ€ pattern example
[code language=â€javaâ€]
/**
* â€¦
* @generated
*/
public static CommonPackage initGen () {
if ( isInited ) {
return (CommonPackage)EPackage.Registry.INSTANCE.getEPackage ( CommonPackage.eNS_URI );
}
final CommonPackageImpl theCommonPackage = (CommonPackageImpl) ( EPackage.Registry.INSTANCE.get ( eNS_URI ) instanceof CommonPackageImpl ? EPackage.Registry.INSTANCE.get ( eNS_URI ) : new CommonPackageImpl () );
isInited = true;
WorldPackage.eINSTANCE.eClass ();
theCommonPackage.createPackageContents ();
theCommonPackage.initializePackageContents ();
theCommonPackage.freeze ();
EPackage.Registry.INSTANCE.put ( CommonPackage.eNS_URI, theCommonPackage );
return theCommonPackage;
}
public static CommonPackage init () {
final CommonPackage result = initGen ();
EValidator.Registry.INSTANCE.put ( result, new ExtensibleValidationDescriptor () );
return result;
}
[/code]
